import React from 'react';
import logo from './logo.svg';
import Counter from './component/Counter';
import './App.css';
import { Provider } from 'react-redux';
import store from './store/store';
function App() {
  return (
    <Provider store={store}>

      <Counter/>
    </Provider>
  );
}

export default App;
